on";s:1632:"This will be extremely helpful for anyone who knows someone that self-harms. As Therapists, we all have our own triggers and limitations. When I first started my career, for me it was self-harm. I always felt a sense of anxiety and extreme stress when a client would disclose that they were harming themselves. Because of my own feelings and concerns, I was reluctant to educate myself further on this matter, and learn more about why people were hurting themselves. Once I was able to learn more, receive intensive supervision from my supervisor on this matter, and go through several valuable and in-depth trainings, I felt so much more competent and able to support my clients. My hope is that this post will help more folks feel better able to have a conversation. Take a read!
